features.script:
// Create GUI
let gui  = feature.createBasicGui()
feature.on('click',e=>{
    if(gui.showing){
    // if GUI is showing, hide it. (act like a toggle)
    gui.destroy()
    return
  }

  // Add our first control:
  gui.addText('Hello!')

  // Call the GUI to show.
  gui.show()

})

let textSign = parcel.getFeatureById('triggerResult')

feature.on('click',e=>{
    textSign.set({text:'dm us on ig/twitter!!'})
})

let closed = true

feature.on('click',e=>{

  if(closed){
      feature.position.z=4.65
  }else{
      feature.position.z=3.5

  }
closed=!closed
})

setInterval(() => {
  let p = parcel.getPlayers()[0]

  if (!p) {
    return
  }

  let v1 = feature.position
  let v2 = p.position
  let angle = Math.atan2(v1.z - v2.z, v1.x - v2.x)

  feature.rotation.y = Math.PI / -2 - angle
}, 200)
